dia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a>&#160;\u2014 \u043f\u0440\u0438\u0441\u0432\u043e\u0435\u043d\u0438\u0435 \u0438\u043c\u0435\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%80%D0%BE%D0%B2,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%9C%D0%B8%D1%80%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0438\u0440\u043e\u0432, \u0421\u0435\u0440\u0433\u0435\u0439 \u041c\u0438\u0440\u043e\u043d\u043e\u0432\u0438\u0447\">\u041a\u0438\u0440\u043e\u0432\u0430 \u0421. \u041c.<\/a> \u0437\u0430\u0432\u043e\u0434\u0443 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4\" title=\"\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0438\u0439 \u0437\u0430\u0432\u043e\u0434\">\u041a\u0440\u0430\u0441\u043d\u044b\u0439 \u043f\u0443\u0442\u0438\u043b\u043e\u0432\u0435\u0446<\/a>\u00bb .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u0438\u0435 \u043d\u0430\u0446\u0438\u0441\u0442\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87%D1%81%D0%BA%D0%BE%D0%B5_%D0%B3%D0%B5%D1%82%D1%82%D0%BE\" title=\"\u0411\u0430\u0440\u0430\u043d\u043e\u0432\u0438\u0447\u0441\u043a\u043e\u0435 \u0433\u0435\u0442\u0442\u043e\">\u0411\u0430\u0440\u0430\u043d\u043e\u0432\u0438\u0447\u0441\u043a\u043e\u0433\u043e \u0433\u0435\u0442\u0442\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1959_%D0%B3%D0%BE%D0%B4\" title=\"1959 \u0433\u043e\u0434\">1959<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0441\u043e\u0437\u0434\u0430\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%BA%D0%B5%