0442\u043e\u0432 \u0432 \u0420\u0438\u043c\u0441\u043a\u043e\u043c \u0430\u044d\u0440\u043e\u043f\u043e\u0440\u0442\u0443<\/a>: \u043f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u043a\u0438\u0435 \u0431\u043e\u0435\u0432\u0438\u043a\u0438 \u0443\u0441\u0442\u0440\u043e\u0438\u043b\u0438 \u0441\u0442\u0440\u0435\u043b\u044c\u0431\u0443 \u0432 \u0437\u0434\u0430\u043d\u0438\u0438 \u0430\u044d\u0440\u043e\u0432\u043e\u043a\u0437\u0430\u043b\u0430, \u043f\u043e\u0441\u043b\u0435 \u0447\u0435\u0433\u043e \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0438\u043b\u0438 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0430\u0432\u0438\u0430\u043b\u0430\u0439\u043d\u0435\u0440 Boeing 707, \u0430 \u0437\u0430\u0442\u0435\u043c \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b\u0438 \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 Boeing 737, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043d\u0430\u043f\u0440\u0430\u0432\u0438\u043b\u0438\u0441\u044c \u0441\u043f\u0435\u0440\u0432\u0430 \u0432 \u0410\u0444\u0438\u043d\u044b, \u0437\u0430\u0442\u0435\u043c \u0432 \u0414\u0430\u043c\u0430\u0441\u043a, \u0430 \u043f\u043e\u0442\u043e\u043c \u0432 \u041a\u0443\u0432\u0435\u0439\u0442. \u0412 \u041a\u0443\u0432\u0435\u0439\u0442\u0435 \u043e\u0441\u0442\u0430\u0432\u0448\u0438\u0435\u0441\u044f \u0437\u0430\u043b\u043e\u0436\u043d\u0438\u043a\u0438 \u0431\u044b\u043b\u0438 \u043e\u0442\u043f\u0443\u0449\u0435\u043d\u044b, \u0441\u0430\u043c\u0438\u0445 \u0442\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u043e\u0432 \u0432\u0441\u043a\u043e\u0440\u0435 \u043e\u0442\u043f\u0443\u0441\u0442\u0438\u043b\u0438. \u0412\u0441\u0435\u0433\u043e \u043f\u043e\u0433\u0438\u0431\u043b\u0438 34 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 (2 \u0432 \u0437\u0434\u0430\u043d\u0438\u0438 \u0420\u0438\u043c\u0441\u043a\u043e\u0433\u043e \u0430\u044d\u0440\u043e\u043f\u043e\u0440\u0442\u0430, 30 \u0432 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0435 \u0438 2 \u0432 \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u043c \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0435).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1974\" class=\"mw-redirect\" title=\"1974\">1974<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B8%D0%B9_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BC%D0%BE%D0%BB%D0%BE%D0%B4%D1%91%D0%B6%D0%BD%D1%8B%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_%D0%BD%D0%B0_%D0%A4%D0%BE%D0%BD%D1%82%D0%B0%D0%BD%D0%BA%D0%B5\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u043d\u044b\u0439 \u0442\u0435\u0430\u0442\u0440 \u043d\u0430 \u0424\u043e\u043d\u0442\u0430\u043d\u043a\u0435\">\u041c\u043e\u043b\u043e\u0434\u0451\u0436\u043d\u044b\u0439 \u0442\u0435\u0430\u0442\u0440<\/a>. \u041f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043f\u044c\u0435\u0441\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D1%80%D1%88%D0%B8%D0%B9_%D1%81%D1%8B%D0%BD_(%D0%BF%D1%8C%D0%B5%D1%81%D0%B0)\" title=\"\u0421\u0442\u0430\u0440\u0448\u0438\u0439 \u0441\u044b\u043d (\u043f\u044c\u0435\u0441\u0430)\">\u0421\u0442\u0430\u0440\u0448\u0438\u0439 \u0441\u044b\u043d<\/a>\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BC%D0%BF%D0%B8%D0%BB%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0412\u0430\u043c\u043f\u0438\u043b\u043e\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u043e\u0432\u0438\u0447\">\u0412\u0430\u043c\u043f\u0438\u043b\u043e\u0432<\/a>)<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1976_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%B8%D1%81%D1%82%D0%BE%D1%80%D0%B8%D0%B8_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD%D0%B0\" title=\"1976 \u0433\u043e\u0434 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430\">1976<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0443\u0447\u0430\u0441\u0442\u043e\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%80%D0%B5%D0%BD%D1%91%D0%B2%D1%81%D0%BA%D0%BE-%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D0%B0%D1%80%D0%BC%D0%B5%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B8%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u0443\u0440\u0435\u043d\u0451\u0432\u0441\u043a\u043e-\u041a\u0440\u0430\u0441\u043d\u043e\u0430\u0440\u043c\u0435\u0439\u0441\u043a\u0430\u044f \u043b\u0438\u043d\u0438\u044f\">\u041a\u0443\u0440\u0435\u043d\u0451\u0432\u0441\u043a\u043e-\u041a\u0440\u0430\u0441\u043d\u043e\u0430\u0440\u043c\u0435\u0439\u0441\u043a\u043e\u0439 \u043b\u0438\u043d\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041a\u0438\u0435\u0432\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u041a\u0438\u0435\u0432\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430<\/a> \u0441 \u0442\u0440\u0435\u043c\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f\u043c\u0438: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C_%D0%9D%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D0%B8_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE,_%D0%9A%D0%B8%